import React from 'react';
import { Link } from 'react-router-dom';

function Inicio() {
    return (
        <div>
            <div className="card border-dark shadow" style={{width: '18rem'}}>
                <div className="card-body">
                    <h5 className="card-title">Card Title</h5>
                    <p className="card-text">Some quick example texto to build on the card title and make up the bulk of the card</p>
                    <Link to='/' className="btn btn-primary">Go somewhere</Link>
                </div>
            </div>



        </div>
    )
}

export default Inicio;
